import { ArgumentComponent } from './pages/user-pages/argument/argument.component';
import { AnswerComponent } from './pages/user-pages/answer/answer.component';
import { SearchComponent } from './pages/user-pages/search/search.component';
import { TermComponent } from './pages/user-pages/term/term.component';
import { BackgroundComponent } from './pages/user-pages/background/background.component';
import { TodayComponent } from './pages/user-pages/today/today.component';
import { AddComponent } from './pages/user-pages/add/add.component';
import { MargumentsComponent } from './pages/user-pages/marguments/marguments.component';
import { MfalseArgumentsComponent } from './pages/user-pages/mfalse-arguments/mfalse-arguments.component';
import { MargumentComponent } from './pages/user-pages/margument/margument.component';
import { MdictionaryComponent } from './pages/user-pages/mdictionary/mdictionary.component';
import { MaddComponent } from './pages/user-pages/madd/madd.component';


@NgModule({
  declarations: [
    AppComponent,

    TopperComponent,
    HomeComponent,
    ArgumentsComponent,

    AboutComponent,
    DictionaryComponent,
    TrueArgumentsComponent,
    FooterComponent,
    FalseArgumentsComponent,
    IrrefutableArgumentsComponent,

    ArgumentComponent,
    AnswerComponent,
    SearchComponent,
    TermComponent,
    BackgroundComponent,
    TodayComponent,
    AddComponent,
    MargumentsComponent,
    MfalseArgumentsComponent,
    MargumentComponent,
    MdictionaryComponent,
    MaddComponent


  ],
  imports: [
    BrowserAnimationsModule,
    BrowserModule,
    AppRoutingModule,
    HttpClientModule,
    FormsModule,
  ],
  providers: [

  ],
  bootstrap: [AppComponent]
})
export class AppModule { }
